import classes from "./Friends.module.css"

const Friends = (props) => {

   let friendsList = props.friends.map((friend) => {
      return <Friend name={friend.name} avatar={friend.avatar}/>
   })
   return (
      <div className={classes.friends}>
         <div className={classes.friend}>
            <div className={classes.friendAvatar}>
               <img src="https://w7.pngwing.com/pngs/236/25/png-transparent-computer-icons-avatar-friends-love-text-logo.png" alt="" />
            </div>
            <div className={classes.friendInfo}>
               {props.state.navBar.friendsList}
            </div>
         </div>
      </div>
   )
}
export default Friends
